#!/usr/bin/perl -w

use strict;
use warnings;
use Compress::Bzip2;
use MIME::Base64;

chomp($_ = <DATA>);
$_ = decode_base64($_);
$_ = decompress($_);
@_ = split(/\n/, $_);

$\ = "\n";
while (<>) {
    chomp;
    if (/^\d\d\d\d$/ && 1001 <= $_ && $_ <= 3436) {
        print $_ == 3374 ? "(9) Adjacent Numbers" : $_[$_ - 1001];
    } else {
        print "No such problem";
    }
}

